import React, { useState } from "react";
const Dummy = () => {
  const [item, setItem] = useState([
    {
      id: 1,
      cheacked: true,
      content: "Morning",
    },
    {
      id: 2,
      checked: false,
      content: "Afternoon",
    },
    {
      id: 1,
      checked: false,
      content: "Night",
    },
  ]);

  return (
    <>
      <ul>
        {item.map((data) => (
          <li>
            <input type="checkbox" checked={data.checked} />
            <label>{data.content}</label>
            <button>Delete</button>
          </li>
        ))}
      </ul>
    </>
  );
};
export default Dummy;
